import Items from './Items';
import './App.css';

function App() {
  return (
    <div className="App">

       <table id="menu">
  <tr>
    <th>Food</th>
    <th>Name</th>
    <th>Price</th>
    <th>Add</th>
  </tr>
  <tr>
    <td><img src={Items.item}/></td>
    <td>{Items.name}</td>
    <td>{Items.price}</td>
    <td><input type="checkbox"></input></td>
  </tr>

</table>
    </div>
  );
}

export default App;
